import classes from "./CitiesDropdownMenu.module.css";
import citiesData from "../data/gradovi.json";
import { useEffect, useState } from "react";

const CitiesDropdownMenu = (props) => {
  const [cities, setCities] = useState([]);

  useEffect(() => {
    setCities(citiesData);
  }, []);

  const filteredCities = cities.filter((obj) => {
    return obj.city.toLowerCase().indexOf(props.title.toLowerCase() === 0);
  });

  console.log(filteredCities);

  return filteredCities.map((obj) => <div> {obj.city}</div>);
};

export default CitiesDropdownMenu;
